import Flutter
import UIKit

public class ExchangePlugin: NSObject, FlutterPlugin, PluginShareDataCallback, ThirdEventCallback {
    private var channel: FlutterMethodChannel

    static var thirdEventCallbacks: [ThirdEventCallback] = []

    static let openChatService: String = "openChatService"

    static let channelName: String = "app.exchange"

    static var shareDataPlugin: ExchangePlugin?

    let cacheEngineName = "abpay_wallet"

    lazy var engineGroup = FlutterEngineGroup(name: ExchangePlugin.channelName, project: nil)

    private var flutterEnginCache = [String: FlutterEngine]()

    public static func register(with registrar: FlutterPluginRegistrar) {
        let channel = FlutterMethodChannel(name: "app.exchange", binaryMessenger: registrar.messenger())
        let instance = ExchangePlugin(channel: channel)
        registrar.addMethodCallDelegate(instance, channel: channel)
        registrar.addApplicationDelegate(instance)
    }

    init(channel: FlutterMethodChannel) {
        self.channel = channel
        super.init()
        ExchangePlugin.thirdEventCallbacks.append(self)
    }

    // 获取当前的ViewController
    func getCurrentViewController() -> UIViewController {
        var rootViewController = UIApplication.shared.delegate?.window??.rootViewController
        while let presentedViewController = rootViewController?.presentedViewController {
            rootViewController = presentedViewController
        }
        return rootViewController!
    }

    // 获取当前的NavigationController
    func getCurrentNavigationController() -> UINavigationController? {
        let currentViewController = self.getCurrentViewController()
        if let navigationController = currentViewController as? UINavigationController {
            return navigationController
        } else {
            return currentViewController.navigationController
        }
    }

    public func handle(_ call: FlutterMethodCall, result: @escaping FlutterResult) {
        switch call.method {
        case "openABPay":
            ExchangePlugin.shareDataPlugin = self
            let engine = self.cacheFlutterEngine()
            let flutterCtrl = FlutterViewController(engine: engine, nibName: nil, bundle: nil)
            if let navigationController = getCurrentNavigationController() {
                navigationController.pushViewController(flutterCtrl, animated: true)
            } else {
                // 如果没有NavigationController，使用present方式
                self.getCurrentViewController().present(flutterCtrl, animated: true)
            }
            result(nil)
//                        NotificationCenter.default.post(
        //                name: NSNotification.Name(rawValue: "openABPay"),
        //                object: self,
        //                userInfo: ["result": result])
        //
        ////            ExchangePlugin.shareDataPlugin = self
        ////            let engine = self.cacheFlutterEngine()
        ////
        ////            let flutterCtrl = FlutterViewController(engine: engine, nibName: nil, bundle: nil)
        //////                                        navigationController.pushViewController(flutterCtrl, animated: true);
        ////            let navigationCl = UIApplication.shared.delegate?.window??.rootViewController?.navigationController
        ////            navigationCl?.pushViewController(flutterCtrl, animated: true)
        ////            result(nil)
        case ExchangePlugin.openChatService:

              NotificationCenter.default.post(
                  name: NSNotification.Name(rawValue: ExchangePlugin.openChatService),
                  object: self,
                  userInfo: ["param": call.arguments as Any, "result": result])

        case "getAuthInfo":
            ExchangePlugin.shareDataPlugin?.getAuthInfo { res in
                if !(res is FlutterError) {
                    result(res)
                } else {
                    result(nil)
                }
            }
        case "sendThirdEvent":
            let args = call.arguments as! [String: Any?]
            let event = args["event"] as! String
            let data = args["data"] as Any?
            for e in ExchangePlugin.thirdEventCallbacks {
                e.onThirdEvent(event: event, data: data)
            }
            result(nil)
        default:
            result(FlutterMethodNotImplemented)
        }
    }

    func getAuthInfo(result: @escaping (FlutterResult)) {
        self.channel.invokeMethod("getOriginAuthInfo", arguments: nil, result: result)
    }

    private func cacheFlutterEngine() -> FlutterEngine {
        var engine = self.flutterEnginCache[cacheEngineName]
        if engine == nil {
            engine = self.engineGroup.makeEngine(withEntrypoint: "mainABPay", libraryURI: nil)
            registerPluginsForEngine(engine!)
            engine!.run()
            self.flutterEnginCache[cacheEngineName] = engine!
        }
        return engine!
    }

    func onThirdEvent(event: String, data: Any?) {
        self.channel.invokeMethod("onThirdEvent", arguments: ["event": event, "data": data])
    }

    public func detachFromEngine(for registrar: any FlutterPluginRegistrar) {
        ExchangePlugin.thirdEventCallbacks.removeAll {
            guard let callbackNSObject = $0 as? NSObject,
                  let selfNSObject = self as? NSObject
            else {
                return false
            }
            return callbackNSObject === selfNSObject
        }
        if ExchangePlugin.shareDataPlugin == self {
            ExchangePlugin.shareDataPlugin = nil
        }
    }
}

protocol PluginShareDataCallback {
    func getAuthInfo(result: @escaping (FlutterResult))
}

protocol ThirdEventCallback {
    func onThirdEvent(event: String, data: Any?)
}

// 安全注册插件的方法
private func registerPluginsForEngine(_ engine: FlutterEngine) {
    // 方法1：直接调用（如果GeneratedPluginRegistrant可用）
//        GeneratedPluginRegistrant.register(with: engine)

    // 或者方法2：动态调用（更安全）

    if let registrantClass = NSClassFromString("GeneratedPluginRegistrant") as? NSObject.Type {
        if registrantClass.responds(to: Selector(("registerWithRegistry:"))) {
            registrantClass.perform(Selector(("registerWithRegistry:")), with: engine)
        }
    }
}
